import React from 'react';
import Peopleinfo from './Peopleinfo';

const PeopleinfoList = ({ people }) => {
    return (
        <div>
            {
                people.map((user, i) => {
                    return (
                        <Peopleinfo
                            key={i}

                            name={`Name: ${people[i].name}`}
                            birth_yearail={people[i].birth_yearail}
                            height={people[i].height}
                            mass={people[i].mass}
                        />
                    );
                })
            }
        </div>
    );
}

export default PeopleinfoList;
